import React from 'react';
import { NavLink } from "react-router-dom";
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Typography from '@material-ui/core/Typography';
import Pico from "../src/Images/Alpha4.png";


const CardData=[{
    Img: Pico,
    Title:"Web Tech",
    
},
{
    Img: Pico,
    Title:"React Expert",
    
},
{
    Img: Pico,
    Title:"Material Ui Card",
    
},];

const useStyles = makeStyles({
  root: {
    maxWidth: 345,
    boxShadow
  },
  media: {
    height: 170,
  },
});

const Cards = (prop) => {
  const classes = useStyles();

  return (
    <Card className={classes.root}>
      <CardActionArea>
        <CardMedia
          className={classes.media}
          image={prop.Img}
          title={prop.value}
        />
        <CardContent>
          <Typography gutterBottom variant="h5" component="h2">
          {prop.value}
          </Typography>
          <Typography variant="body2" color="textSecondary" component="p">
           React is Javascript library.It is easy  sometime and some time it became hard.But yo
           know one thing hard roads always tend to beautiful destinations.
          </Typography>
        </CardContent>
      </CardActionArea>
      <CardActions className="mb-2">
      <NavLink variant="outlined" to='/service' className=" buton py-1 px-3">Share</NavLink>
      <NavLink variant="outlined" to='/service' className=" buton py-1 px-3">Learn More</NavLink>
      </CardActions>
    </Card>
  );
}
export default Cards;
export {CardData};
